import "./Intro.scss";

function Intro(prop) {
  return (
    <div className="intro">
        <h2>Hi, my name is</h2>
        <h1>Mahzabin Rashid.</h1>
        <p>I’m a second-year student at the University of Waterloo pursuing a degree in Computer Science. I’m currently seeking Summer 2022 internship opportunities.

Previously, I worked at Modumate, a startup based in San Francisco as the only self-managed frontend engineer of the team. Most recently, I worked on Coffee Hours, a youth-friendly website used for facilitating virtual coffee chats with current students, faculty members and alumni from universities across Canada.</p>


    </div>
  );
}

export default Intro;
